import React from 'react';
import './App.css';
import Button from './component/Button';
import axios from 'axios';

function App() {

  state = {
    name: '',
  }

  axios = () => {
    axios.get('https://dog.ceo/api/breeds/image/random')
    .then(response => {
      this.setState({ name: response.data.message });
    })
    .catch(error => {
      console.log(error);
    });
  }

  return (

    <div className="App">
      <nav className="nav">
        <h1 className="nav__title">Dashboard</h1>
        <h2 className="nav__subtitle">Liste des entreprises :</h2>
      </nav>
      <div className="dashboard">
        <p className="dashboard__title">Rechercher une entreprise</p>
        <input className="dashboard__input" type='text'/>
        <button className="dashboard__button">rechercher</button>
        <Button />
      </div>
    </div>
  );
}

export default App;
